DROP TABLE IF EXISTS VUELO CASCADE;
DROP TABLE IF EXISTS RESERVA CASCADE;
DROP TABLE IF EXISTS CLIENTE CASCADE;
DROP TABLE IF EXISTS AVION CASCADE;
DROP TABLE IF EXISTS AEROPUERTO CASCADE;





---- DDL

CREATE TABLE AEROPUERTO
(
	ID_AEROPUERTO			INTEGER,
	NOMBRE					VARCHAR(100),
	CIUDAD					VARCHAR(100),
	CONSTRAINT PK_AEROPUERTO PRIMARY KEY (ID_AEROPUERTO)
);

CREATE TABLE AVION
(
	ID_AVION				INTEGER,
	NOMBRE					VARCHAR(50),
	MAX_PASAJEROS			INTEGER,
	TIPO_PASILLO			VARCHAR(30),
	CONSTRAINT PK_AVION PRIMARY KEY (ID_AVION)
);


CREATE TABLE VUELO
(
	ID_VUELO				INTEGER,
	DESDE					INTEGER,
	HASTA					INTEGER,
	SALIDA					TIMESTAMP,
	LLEGADA					TIMESTAMP,
	PRECIO					NUMERIC(7,2),
	DESCUENTO				INTEGER,
	ID_AVION				INTEGER,
	CONSTRAINT PK_VUELO PRIMARY KEY (ID_VUELO),
	CONSTRAINT FK_VUELO_AERO1 FOREIGN KEY (DESDE) REFERENCES AEROPUERTO,
	CONSTRAINT FK_VUELO_AERO2 FOREIGN KEY (HASTA) REFERENCES AEROPUERTO,
	CONSTRAINT FK_VUELO_AVION FOREIGN KEY (ID_AVION) REFERENCES AVION
);


CREATE TABLE CLIENTE
(
	ID_CLIENTE				INTEGER,
	NOMBRE					VARCHAR(50),
	APELLIDO1				VARCHAR(50),
	APELLIDO2				VARCHAR(50),
	FECHA_NACIMIENTO		DATE,
	CONSTRAINT PK_CLIENTE PRIMARY KEY (ID_CLIENTE)
);


CREATE TABLE RESERVA
(
	ID_RESERVA				INTEGER,
	FECHA_RESERVA			TIMESTAMP,
	ID_VUELO				INTEGER,
	ID_CLIENTE				INTEGER,
	CONSTRAINT PK_RESERVA PRIMARY KEY (ID_RESERVA),
	CONSTRAINT FK_RESERVA_VUELO FOREIGN KEY (ID_VUELO) REFERENCES VUELO,
	CONSTRAINT FK_RESERVA_CLIENTE FOREIGN KEY (ID_CLIENTE) REFERENCES CLIENTE
);


